import {StyleSheet} from "react-native"

export default StyleSheet.create({
    image:{
      width: 190,
      height: 150,
      marginTop: "10%"
    },
    card:{
      backgroundColor: '#f5f5f5',
      width: "70%",
      height: "55%",
      borderRadius: 5,
      alignItems: 'center',
      justifyContent: 'space-evenly',
      marginTop: "10%",
      shadowColor: "#000",
      shadowOffset: {
        width: 0,
        height: 12,
      },
      shadowOpacity: 0.58,
      shadowRadius: 16.00,
      elevation: 24
    },
    input:{
      width: "80%",
      borderBottomWidth: 1,
      borderBottomColor: 'black',
      padding: "2%",
    },
    botao1:{
      color:"blue",
